func solve(input *lib_Input) int64 {
	M := input.MustGetInt64Value(0, 1)
	drinks := input.MustGetInt64LinesFrom(1)
	sort.Slice(drinks, func(i, j int) bool {
		a1 := drinks[i][0]
		a2 := drinks[j][0]
		return a1 < a2
	})

	moneySum := int64(0)
	drinkCnt := int64(0)
	for _, drink := range drinks {
		a := drink[0]
		b := drink[1]
		for i := int64(0); i < b; i++ {
			moneySum += a
			drinkCnt++
			if drinkCnt == M {
				return moneySum
			}
		}
	}
	panic("no answer")
}

func main() {
	input := lib_MustNewInputFromReader(bufio.NewReader(io.Reader(os.Stdin)))
	fmt.Println(solve(input))
}

